package com.ufgov.zc.server.gwk.publish.impl.exporter;import java.util.List;import com.ufgov.zc.common.gwk.publish.IGwkServiceDelegate;import com.ufgov.zc.common.system.RequestMeta;import com.ufgov.zc.common.system.dto.ElementConditionDto;import com.ufgov.zc.server.system.SpringContext;public class GwkServiceExporter implements IGwkServiceDelegate {  private IGwkServiceDelegate gwkServiceDelegate = (IGwkServiceDelegate) SpringContext  .getBean("gwkServiceDelegate");  public List getCardInfo(ElementConditionDto dto, RequestMeta requestMeta) {    return gwkServiceDelegate.getCardInfo(dto, requestMeta);  }  public List getCpGwkCoPaymentInfo(ElementConditionDto dto, RequestMeta requestMeta) {    return gwkServiceDelegate.getCpGwkCoPaymentInfo(dto, requestMeta);  }  public List getCpGwkBankPaymentInfo(ElementConditionDto dto, RequestMeta requestMeta) {    return gwkServiceDelegate.getCpGwkBankPaymentInfo(dto, requestMeta);  }  public void insertTradeInfo(List tradeInfoList, RequestMeta requestMeta) {    gwkServiceDelegate.insertTradeInfo(tradeInfoList, requestMeta);  }  public void deleteTradeInfo(List tradeInfoList, RequestMeta requestMeta) {    gwkServiceDelegate.deleteTradeInfo(tradeInfoList, requestMeta);  }  public List getTradeInfo(ElementConditionDto dto, RequestMeta requestMeta) {    return gwkServiceDelegate.getTradeInfo(dto, requestMeta);  }  public void auditTradeInfo(List tradeInfoList, RequestMeta requestMeta) {    gwkServiceDelegate.auditTradeInfo(tradeInfoList, requestMeta);  }  public void blankoutTradeInfo(List tradeInfoList, RequestMeta requestMeta) {    gwkServiceDelegate.blankoutTradeInfo(tradeInfoList, requestMeta);  }  public List getGwkAnalyzeInfo(ElementConditionDto dto, RequestMeta requestMeta) {    return gwkServiceDelegate.getGwkAnalyzeInfo(dto, requestMeta);  }}